import React, { Component } from 'react';

class Register extends Component {
    //name ,email,password,confrimpassword
    state={
        name:"",
        email:"",
        password:"",
        confrimpassword:"",
        error:{}
    }
    changeHandeler=(event)=>{
        this.setState({
            [event.target.name]:event.target.value
        })
    }

    onSubmitHandeler=(event)=>{
        event.preventDefault()
    }




    render() {
        let {name,email,password,confrimpassword,error}=this.state 
        return (
            <div className="row">
                <div className="col-md-6 offset-md-3">
                    <h1 className="text-center display-4">Register</h1>
                    <form onSubmit={this.onSubmitHandeler}>

                        <div className="form-group">
                            <label htmlFor="name">Name:</label>
                            <input type="text"
                                    className="form-control"
                                    placeholder="Enter Your Name"
                                    name="name"
                                    id="name"
                                    value={name}
                                    onChange={this.changeHandeler}
                            />


                        </div>
                        
                        <div className="form-group">
                            <label htmlFor="email">Email:</label>
                            <input type="text"
                                    className="form-control"
                                    placeholder="Enter Your Email"
                                    name="email"
                                    id="email"
                                    value={email}
                                    onChange={this.changeHandeler}
                            />
                        </div> 
                        
                        
                        
                        
                        <div className="form-group">
                            <label htmlFor="password">Password:</label>
                            <input type="password"
                                    className="form-control"
                                    placeholder="Enter Your Password"
                                    name="password"
                                    id="password"
                                    value={password}
                                    onChange={this.changeHandeler}
                            />
                        </div> 
                        
                        <div className="form-group">
                            <label htmlFor="confirmPassword">Confirm Password:</label>
                            <input type="password"
                                    className="form-control"
                                    placeholder="Confirm Your Password"
                                   name="confrimpassword"
                                    id="confirmPassword"
                                    value={confrimpassword}
                                    onChange={this.changeHandeler}
                            />
                        </div>

                        <Link to="/register">Don't Have Account? Register here</Link>
                        <button onSubmit={this.onSubmitHandeler} className="btn btn-primary">Register</button>

                    </form>

                </div>
            </div>
        );
    }
}

export default Register;
